import React from "react";
import Slider from "react-slick";

const ExternalItem = (props) => {
    const {link} = props;

    return(
        <div className="hero">
            <div className="card custom-card">
                <div className="card-image">
                    <figure className="image is-256x256">
                        <p style={{position:"absolute", zIndex:"1", backgroundColor:"rgb(0,0,0,0.3)", color:"white", margin:"1rem"}}> Caption </p>
                        <img style={{position:"relative"}} src={process.env.PUBLIC_URL + "/images/image4.jpg"} />
                        <p style={{position:"absolute"}}> {props.caption} </p>
                    </figure>
                </div>
            </div>
        </div>
    )
}

const ExternalWebsites = props => {
    const externalLinks = [
        {
            id : 0, path : "", title : "", caption : "test1"
        },
        {
            id : 1, path : "", title : "", caption : "test2"
        },
        {
            id : 2, path : "", title : "", caption : "test1"
        },
    ]

    const carousel = externalLinks.map((link,index) => (
        <div key={index} className="column">
            <ExternalItem link={link} key={index} />
        </div>
    ));

    const settingsThumbs = {
        speed: 1000,
        slidesToShow: 2,
        slidesToScroll: 1,
        dots: false,
        arrows: true,
        centerMode: false,
        focusOnSelect: true,
        centerPadding: '5px',
        responsive:[
          {
            breakpoint: 480,
            settings: {
                slidesToShow: 1,
            }
          },
          {
            breakpoint: 600,
            settings: {
                slidesToShow: 1,
            }
          },
          {
            breakpoint: 1025,
            settings: {
                slidesToShow: 2,
            }
          }
        ]
    };

    return (
        <>
            <article className="message is-link is-size-5">
                <div className="message-header">
                    <p> External Links </p>
                </div>
                <div className="message-body">
                    <div className="columns">
                        <Slider {...settingsThumbs}>
                            {carousel}
                        </Slider>
                    </div>
                </div>
            </article>
        </>
    )
}
export default ExternalWebsites;
